      estimatedPrize: 100,
      ethSymbol: "Ξ",
    };
  }

  render() {
    return (
      <div
        className="container"
        onClick={() => {
          alert("hello");
        }}
      >
        <a id="joinpool">Join Pool</a>
      </div>
    );
  }
}
